import{_ as o,c as t,a1 as r,o as i}from"./chunks/framework.BRP8cXOc.js";const a="/agentforce-workshop/getting-started-1.C6QtSBgc.webp",g=JSON.parse('{"title":"Enable and launch Code Builder","description":"","frontmatter":{},"headers":[],"relativePath":"agentforce-workshop/getting-started/enable-code-builder.md","filePath":"agentforce-workshop/getting-started/enable-code-builder.md"}'),n={name:"agentforce-workshop/getting-started/enable-code-builder.md"};function l(s,e,d,c,p,u){return i(),t("div",null,e[0]||(e[0]=[r('<h1 id="enable-and-launch-code-builder" tabindex="-1">Enable and launch Code Builder <a class="header-anchor" href="#enable-and-launch-code-builder" aria-label="Permalink to &quot;Enable and launch Code Builder&quot;">​</a></h1><p>In this workshop, you use Code Builder to deploy Apex classes in some Prompt Builder and Einstein Copilot exercises. Code Builder is a web-based integrated development environment (IDE) built upon the core functionalities of Visual Studio Code (VS Code). It provides a development experience similar to using VS Code with the Salesforce extensions installed, but entirely within a web browser.</p><h2 id="step-1-launch-code-builder" tabindex="-1">Step 1: Launch Code Builder <a class="header-anchor" href="#step-1-launch-code-builder" aria-label="Permalink to &quot;Step 1: Launch Code Builder&quot;">​</a></h2><ol><li><p>Click the <strong>Setup</strong> icon (gear icon in the upper right corner), and click <strong>Setup</strong>.</p></li><li><p>In Quick Find, search for Code Builder, and select <strong>Code Builder</strong>.</p></li><li><p>Dismiss the error message. This is due to the pre-installation of Code Builder.</p></li><li><p>Click the <strong>Enable Code Builder</strong> toggle to enable Code Builder. Review and accept the license agreement.</p></li><li><p>Click the <strong>App Launcher</strong> icon (waffle icon in the upper left corner), and select the <strong>Code Builder</strong> app.</p></li><li><p>In the Code Builder Dashboard, click the <strong>Launch</strong> button.</p></li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>It will take a few minutes for Code Builder to fully initialize. Wait for the <strong>Let’s Get You Started</strong> page to appear before you continue.</p></div><h2 id="step-2-authorize-your-org" tabindex="-1">Step 2: Authorize your Org <a class="header-anchor" href="#step-2-authorize-your-org" aria-label="Permalink to &quot;Step 2: Authorize your Org&quot;">​</a></h2><p>You need to connect Code Builder to your org to be able to deploy code:</p><ol><li><p>Open the command palette (Press <code>CMD+SHIFT+P</code> on Mac or <code>CTRL+SHIFT+P</code> on PC).</p></li><li><p>Search for <strong>Authorize an Org</strong>. If it is not yet available, wait Code Builder to fully initialize. If this command is not available please follow the steps below to create a new project.</p></li><li><p>Select <strong>SFDX: Authorize an Org</strong>.</p></li><li><p>Select <strong>Project Default</strong>.</p></li><li><p>Enter <code>AI-WORKSHOP</code> for the org alias and press <strong>Return</strong>.</p></li><li><p>Click <strong>Connect</strong>. <img src="'+a+'" alt="Screenshot 2024-03-28 at 14.42.17.png" data-zoomable="true"></p></li><li><p>Log in to your org using your credentials.</p></li><li><p>Click <strong>Allow</strong>.</p></li><li><p>Click <strong>Continue</strong>.</p></li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Since Code Builder takes some time to load, we recommend you leave it open in a browser tab.</p></div><h2 id="optional-create-an-sfdx-project" tabindex="-1">Optional: Create an SFDX Project <a class="header-anchor" href="#optional-create-an-sfdx-project" aria-label="Permalink to &quot;Optional: Create an SFDX Project&quot;">​</a></h2><ol><li><p>Open the command palette (Press <code>CMD+SHIFT+P</code> on Mac or <code>CTRL+SHIFT+P</code> on PC).</p></li><li><p>Search <strong>SFDX</strong> and Click on <strong>SFDX: Create Project with Manifest</strong>.</p></li><li><p>Click <strong>Standard</strong>.</p></li><li><p>Enter <code>AI_NOW_WORKSHOP</code> for the org name and press <strong>Return</strong>.</p></li></ol><p>The project will now load and you can repeat step 2 to authorize your org.</p>',12)]))}const b=o(n,[["render",l]]);export{g as __pageData,b as default};
